import React, { useState } from 'react';
import { Modal, Button } from 'react-bootstrap';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';

import Dashboard from './components/Dashboard';
import EmergenciesList from './components/EmergenciesList';
import HomePage from './components/HomePage';
import Login from './components/Login';
import Register from './components/Register';
import ReportEmergency from './components/ReportEmergency';

import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';

function App() {
  const [isAuthenticated, setIsAuthenticated] = useState(false);
  const [showRegister, setShowRegister] = useState(false);
  const [showLogin, setShowLogin] = useState(false);
  const [showReportEmergency, setShowReportEmergency] = useState(false);

  const handleLogin = () => {
    setIsAuthenticated(true);
    setShowLogin(false);
  };

  return (
    <Router>
      <div className="App">
        <header className="App-header">
          <h1>Emergency Response Management System</h1>
          <nav>
            <Link to="/">Home</Link> | 
            <Button variant="link" onClick={() => setShowRegister(true)}>Register</Button> | 
            <Button variant="link" onClick={() => setShowLogin(true)}>Login</Button> | 
            {isAuthenticated && <Button variant="link" onClick={() => setShowReportEmergency(true)}>Report Emergency</Button>} | 
            {isAuthenticated && <Link to="/dashboard">Dashboard</Link>}
          </nav>
        </header>
        <main className="App-main">
          <Routes>
            <Route path="/" element={<HomePage />} />
            <Route path="/emergencies" element={<EmergenciesList />} />
            <Route path="/dashboard" element={<Dashboard />} />
          </Routes>
        </main>

        <Modal show={showRegister} onHide={() => setShowRegister(false)}>
          <Modal.Header closeButton>
            <Modal.Title>Register</Modal.Title>
          </Modal.Header>
          <Modal.Body>
            <Register onSuccess={() => setShowRegister(false)} />
          </Modal.Body>
        </Modal>

        <Modal show={showLogin} onHide={() => setShowLogin(false)}>
          <Modal.Header closeButton>
            <Modal.Title>Login</Modal.Title>
          </Modal.Header>
          <Modal.Body>
            <Login onLogin={handleLogin} />
          </Modal.Body>
        </Modal>

        <Modal show={showReportEmergency} onHide={() => setShowReportEmergency(false)}>
          <Modal.Header closeButton>
            <Modal.Title>Report Emergency</Modal.Title>
          </Modal.Header>
          <Modal.Body>
            <ReportEmergency />
          </Modal.Body>
        </Modal>
      </div>
    </Router>
  );
}

export default App;
